import { ChannelBox, ChannelLogo } from "planby";

export const ChannelItem = ({ channel }) => {
    console.log(channel)
    const { position, image } = channel;
    return (
        <ChannelBox {...position}>
            <ChannelLogo
            src={image}
            alt="Logo"
            style={{ maxHeight: 52, maxWidth: 52 }}
            />
        </ChannelBox>
    );
};
